import React, { useState } from 'react';
import logo from '../../src/pictures-olive/final logo 1.png';
import { AiOutlineClose, AiOutlineMenu } from 'react-icons/ai';
import { useNavigate } from 'react-router-dom';

function Navbar() {
  const [nav, setNav] = useState(true);
  const [showServicesDropdown, setShowServicesDropdown] = useState(false);
  const navigate = useNavigate();

  const handleNav = () => {
    setNav(!nav);
  };

  const toggleServicesDropdown = () => {
    setShowServicesDropdown(!showServicesDropdown);
  };

  return (
    <>
      <div>
        <div className='flex justify-between items-center h-20 max-w-[2000px] mx-10 px-100 text-white py-20 bg-black'>
          <button
            className='p-10 md:w-[250px] sm:w-[50px] text-5xl font-extrabold'
            alt='logo name gate guru'
            style={{ fontFamily: 'Roboto ' }}
          >
            Gait.Guru
          </button>
          <ul className='hidden md:flex'>
            <button
              className='p-4 hover:bg-[#F1F8FF] hover:scale-110 rounded-full hover:text-black'
              onClick={() => navigate('/Home')}
            >
              Home
            </button>
            <button
              className='p-4 hover:bg-[#F1F8FF] hover:scale-110 rounded-full  hover:text-black'
              onClick={() => navigate('/Services')}
              onMouseEnter={toggleServicesDropdown}
              onMouseLeave={toggleServicesDropdown}
            >
              Services
              {showServicesDropdown && (
                <div className='absolute bg-white mt-1 py-2 rounded-md border border-gray-300'>
                  <button
                    className='block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100'
                    onClick={() => navigate('/MultiviewAnalysis')}
                  >
                    Multiview Analysis
                  </button>
                  <button
                    className='block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100'
                    onClick={() => navigate('/ReportAnalysis')}
                  >
                    Report Analysis
                  </button>
                </div>
              )}
            </button>
            <button
              className='p-4 hover:bg-[#F1F8FF] hover:scale-110 rounded-full  hover:text-black'
              onClick={() => navigate('/About')}
            >
              About
            </button>
            <button className='p-4 hover:bg-[#F1F8FF] hover:scale-110 rounded-full  hover:text-black'>
              Settings
            </button>
          </ul>
          <div onClick={handleNav} className='block md:hidden  sm:mx-90'>
            {!nav ? <AiOutlineClose size={30} /> : <AiOutlineMenu size={30} />}
          </div>
          <div className={!nav ? 'fixed left-0 top-0 w-[40%]  h-full border-r-black ease-in-out mr-100 bg-white duration-150' : 'fixed left-[-100%]'}>
            <ul className='pt-5  uppercase text-black m-4'>
              <img className='p-6' src={logo} alt='' />
              <button className='p-6 m-4 border-b border-white-600' onClick={() => navigate('/Home')}>
                Home
              </button>
              <button className='p-7  m-5 border-b border-white-600' onClick={() => navigate('/Services')}>
                Services
              </button>
              <button className='p-7  m-6  border-b border-white-600' onClick={() => navigate('/About')}>
                About
              </button>
            </ul>
          </div>
        </div>
      </div>
    </>
  );
}

export default Navbar;
